			/>
			<br />
			<TextField
				label='Password'
				variant='standard'
				onChange={(event) => {
					setPassword(event.target.value);
				}}
			/>
			<br />
			<TextField
				label='Confirm Password'
				variant='standard'
				onChange={(event) => {
					setConfirm(event.target.value);
				}}
			/>
			<br />
			<Button variant='outlined' onClick={handleSubmit}>
				Primary
			</Button>
		</div>
	);
}

export default SignIn;
